import React from 'react'
import { observer } from "mobx-react-lite";
import { Container, Nav, Navbar, NavDropdown } from 'react-bootstrap'

const Navigation = observer(() => {
    return (
        <Navbar>
            <div/>
        </Navbar>
    )
})

export default Navigation
